import React from "react";
import photoProfil from "../images/photoprofil.webp";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  let myNavigation = " col-xl-3 myNavigation text-center p-5 text-light";
  let navItem = "nav-item  ";
  let navLinkStyle = "text-decoration-none text-light display-6 fw-bold";
  let liItem = document.querySelectorAll("li");

  return (
    <div className={myNavigation}>
      <div className="profilNamePhoto">
        {/* <img scr={photoProfil} alt="photo-profil" /> */}
        <h1 className="display-3 fw-bold  ">
          MOUSSA <br />
          MAHAMOUD
        </h1>
        <p className="fw-bold display-2  ">Developpeur Web</p>
      </div>

      <div>
        <ul className="nav d-flex flex-column list-group text-light ">
          <NavLink exact to="/" activeClassName="sisi" className={navLinkStyle}>
            <li className={navItem}>Acceuil</li>
          </NavLink>

          <NavLink exact to="/knowledges" className={navLinkStyle}>
            <li className="nav-item p-5   " activeClassName="sisi">
              Connaissances
            </li>
          </NavLink>

          <NavLink exact to="/contact" className={navLinkStyle}>
            <li>Contact</li>
          </NavLink>
        </ul>
      </div>
    </div>
  );
};

export default Navigation;
